    [],nt"revision_timestamp": "2015-09-26T20:27:53.915340",nt"name": "collection-of-observed-gravity-values-absolute-gravity-measurements-grids-and-other-derived-sum",nt"isopen":
    false,nt"url": null,nt"notes": "The National Geophysical Data Center (NGDC)
    of NOAA, in cooperation with the National Geodetic Survey of NOAA, have published
    a Gravity CD-ROM containing observed and derived gravity measurements. Contributions
    to this data compilation include many national and international organizations,
    in both academia and government. The compact disc contains almost 620 Mbytes of
    data, partitioned into 1486 files. Approximately 25 percent of the data are observed
    values -- regional station data collections (separated primarily by contributors)
    and absolute gravity measurements. Grids and other derived summary data sets represent
    another 65 percent of the data. The remaining 10 percent of the disc contains geopolitical
    base map reference data and software.",nt"license_title": null,nt"extras":
